import React from 'react';
import './App.css';
import data from './data';
import Header from './components/Header';
import MovieList from './components/MovieList';

function App() {
  return (
    <div className="App">
      <Header className="movie-card-header" />
      <MovieList movies={ data } />
    </div>
  );
}

export default App;
